// src/pages/SuperAdmin/SchoolAdmins.jsx
import { useEffect, useState } from "react";
import API from "../../services/api";

function SchoolAdmins() {
  const [admins, setAdmins] = useState([]);
  const [schools, setSchools] = useState([]);
  const [form, setForm] = useState({ username: "", password: "", school_id: "" });

  useEffect(() => {
    fetchAdmins();
    fetchSchools();
  }, []);

  // Fetch admins
  const fetchAdmins = async () => {
    try {
      const res = await API.get("/schooladmins");
      setAdmins(res.data);
    } catch (err) {
      console.error("Error fetching admins:", err);
    }
  };

  // Fetch schools (to assign new admin)
  const fetchSchools = async () => {
    try {
      const res = await API.get("/schools");
      setSchools(res.data);
    } catch (err) {
      console.error("Error fetching schools:", err);
    }
  };

  // Add admin
  const addAdmin = async (e) => {
    e.preventDefault();
    try {
      await API.post("/schooladmins", form);
      setForm({ username: "", password: "", school_id: "" });
      fetchAdmins();
    } catch (err) {
      console.error("Error creating admin:", err);
    }
  };

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-6">Manage School Admins</h1>

      {/* Add Admin Form */}
      <form onSubmit={addAdmin} className="mb-6 bg-white p-4 rounded shadow flex gap-3">
        <input
          type="text"
          placeholder="Username"
          value={form.username}
          onChange={(e) => setForm({ ...form, username: e.target.value })}
          className="p-2 border rounded flex-1"
          required
        />
        <input
          type="password"
          placeholder="Password"
          value={form.password}
          onChange={(e) => setForm({ ...form, password: e.target.value })}
          className="p-2 border rounded flex-1"
          required
        />
        <select
          value={form.school_id}
          onChange={(e) => setForm({ ...form, school_id: e.target.value })}
          className="p-2 border rounded flex-1"
          required
        >
          <option value="">Select School</option>
          {schools.map((s) => (
            <option key={s.id} value={s.id}>
              {s.name}
            </option>
          ))}
        </select>
        <button type="submit" className="bg-blue-500 text-white px-4 rounded">
          Add Admin
        </button>
      </form>

      {/* Admins Table */}
      <div className="bg-white p-4 rounded shadow">
        <h2 className="text-xl font-semibold mb-3">All School Admins</h2>
        <table className="w-full border">
          <thead>
            <tr className="bg-gray-200">
              <th className="p-2 border">ID</th>
              <th className="p-2 border">Username</th>
              <th className="p-2 border">Role</th>
              <th className="p-2 border">School</th>
            </tr>
          </thead>
          <tbody>
            {admins.map((a) => (
              <tr key={a.id}>
                <td className="p-2 border">{a.id}</td>
                <td className="p-2 border">{a.username}</td>
                <td className="p-2 border">{a.role}</td>
                <td className="p-2 border">{a.school_name}</td>
              </tr>
            ))}
            {admins.length === 0 && (
              <tr>
                <td colSpan="4" className="text-center p-3">
                  No admins found
                </td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default SchoolAdmins;
